import React from 'react';

import './sidenav.css';

export const SideNav = ({ handleSectionClick }) => {
    return (
        <div className="sidenav">
            <img
                src="https://https://www.google.com/search?q=lady+coder&tbm=isch&chips=q:female+coders,g_1:coding:uQ6Bdlm4z2g%3D&hl=en&ved=2ahUKEwjb9Ov3kZjqAhVXnEsFHepkChcQ4lYoAXoECAEQFw&biw=1838&bih=981#imgrc=UnsgWKPQbX29jM.githubusercontent.com/u/26179770?s=400&u=c192e93f9e95569393dc3ba8875e3214940ff01e&v=4"
                className="avatar"
                alt="my look"
            />
            <h2 className="main-name">Sampada Naik</h2>
            <p className="subtitle">"A Student"</p>
            <div className="sections-list">
                <p className="section-list-element" onClick={() => handleSectionClick("about")}>About Me</p>
                <p className="section-list-element" onClick={() => handleSectionClick("skills")}>Skills</p>
                <p className="section-list-element" onClick={() => handleSectionClick("projects")}>Projects</p>
            </div>
        </div>
    );
};
